SELECT ROUND(AVG(Items.price)) AS ___, EXTRACT(MONTH FROM Purchases.date) AS , EXTRACT(YEAR FROM Purchases.date) AS 
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 18 AND 25
GROUP BY , EXTRACT(MONTH FROM Purchases.date)
ORDER BY , EXTRACT(MONTH FROM Purchases.date)
;
SELECT ROUND(AVG(Q.AVG_PER_MONTH)) AS ____18__25
FROM
(
SELECT ROUND(AVG(Items.price)) AS AVG_PER_MONTH
FROM Purchases INNER JOIN Users USING(userId) INNER JOIN Items USING(itemId)
WHERE Users.age BETWEEN 18 AND 25
GROUP BY EXTRACT(YEAR FROM Purchases.date), EXTRACT(MONTH FROM Purchases.date)
) AS Q
;

